import React, { Component } from 'react';
import DetailPage from './DetailPage.js';

class Detail extends Component {

  constructor(props) {
    super(props);
    this.state = {
      data: {
        issuerTitle: props.match.params.issuerTitle,
        issuerIcon: props.match.params.issuerIcon,
        issuerInfo: props.match.params.issuerInfo,
      },
    }
  }

  render() {
    return (
      <DetailPage data={this.state.data}></DetailPage>
    );
  }
}
export default Detail;
